import { Link } from "react-router-dom";
import styles from "../../../styles/styles";
import { Swiper, SwiperSlide } from 'swiper/react';
import Background from "./2880x600.jpeg";
import cosmetics from "./2880x601.jpeg";
import homebanner from "./2880x602.png";
// Import Swiper styles
import 'swiper/css';
const Hero = () => {
  return (
        <Swiper
      spaceBetween={50}
      slidesPerView={1}
      onSlideChange={() => console.log('slide change')}
      onSwiper={(swiper) => console.log(swiper)}
    >
      <SwiperSlide>
      <div
      className={`relative min-h-[300px] 800px:min-h-[600px] bg-contain w-full bg-no-repeat ${styles.noramlFlex}`}
      style={{
        backgroundImage:
          "url("+ Background +")"
      }}
    >

    </div>
      </SwiperSlide>
      <SwiperSlide>
      <div
      className={`relative min-h-[300px] 800px:min-h-[600px] bg-contain w-full bg-no-repeat ${styles.noramlFlex}`}
      style={{
        backgroundImage:
          "url("+ homebanner +")"
      }}
    >

    </div>
      </SwiperSlide>

      <SwiperSlide>
            <div
      className={`relative min-h-[300px] 800px:min-h-[600px] bg-contain w-full bg-no-repeat ${styles.noramlFlex}`}
      style={{
        backgroundImage:
          "url("+ cosmetics +")"
      }}
    >

    </div>
    </SwiperSlide>
    </Swiper>
  );
};

export default Hero;
